INSERT INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`)
VALUES
(844,0,0,'Wares for sale! Wares for sale! Come browse Antonio''s wares before I must take my leave, citizens of Goldshire.',14,7,100,22,0,0,721,0,'Antonio Perelli'),
(844,0,1,'Come one, come all! Antonio''s wares are for sale. I may not return for a great deal of time, so come one, come all.',14,7,100,22,0,0,722,0,'Antonio Perelli'),
(844,0,2,'Good people of Goldshire, come take advantage of my incredible prices on rare goods. I shall not return for some time!',14,7,100,22,0,0,723,0,'Antonio Perelli'),
(844,1,0,'Good bye, Goldshire. I''ll be back soon enough-- perhaps a week''s time.',12,7,100,3,0,0,724,0,'Antonio Perelli'),
(844,2,0,'Known throughout the lands, Antonio Perelli''s goods now for sale near Sentinel Hill! I must move on soon, so make haste.',14,7,100,22,0,0,726,0,'Antonio Perelli'),
(844,2,1,'Long-lasting, well-crafted items for sale near the Hill! Come one, come all! Time is short, so make haste.',14,7,100,22,0,0,727,0,'Antonio Perelli'),
(844,2,2,'The time has come for me to once again make my wares available to all who travel near Sentinel Hill! Come one, come all!',14,7,100,22,0,0,728,0,'Antonio Perelli'),
(844,3,0,'Thank you, all. I shall return again in about a week.',12,7,100,3,0,0,729,0,'Antonio Perelli'),
(844,4,0,'Off to Darkshire then, I suppose.',12,7,100,0,0,0,730,0,'Antonio Perelli'),
(844,5,0,'%s lets out a deep sigh.',16,0,100,0,0,0,683,0,'Antonio Perelli'),
(844,6,0,'I hate this part of my job. Oh Duskwood, be gentle with poor Antonio.',12,7,100,0,0,0,684,0,'Antonio Perelli'),
(844,7,0,'Travelers and adventurers make haste to the town circle and take advantage of Antonio''s wonderful prices! Come one, come all!',14,7,100,22,0,0,688,0,'Antonio Perelli'),
(844,7,1,'Well met, travelers of Duskwood! My incredible wares are on sale for a short time in Darkshire. Make haste!',14,7,100,22,0,0,689,0,'Antonio Perelli'),
(844,7,2,'Leave your battles or errands, and browse my incredible wares! Only in Darkshire for a short time... praise the Light for that.',14,7,100,22,0,0,690,0,'Antonio Perelli'),
(844,8,0,'Farewell, citizens of Darkshire. Until next time...',12,7,100,3,0,0,691,0,'Antonio Perelli'),
(844,9,0,'Finally, Redridge. A pleasant change from the dark, cold fog of Duskwood.',12,7,100,0,0,0,692,0,'Antonio Perelli'),
(844,10,0,'Hello, hello, Amy. It''s good to be back in Lakeshire and to see you, milady.',12,7,100,3,0,0,702,0,'Antonio Perelli'),
(844,11,0,'I''ve finally reached Lakeshire-- come one, come all, and take advantage of Antonio Perelli''s wonderful deals.',14,7,100,22,0,0,712,0,'Antonio Perelli'),
(844,11,1,'Items powerful enough to help make the journey through Duskwood, Antonio Perelli''s goods are now for sale here in Lakeshire.',14,7,100,22,0,0,713,0,'Antonio Perelli'),
(844,11,2,'Hear ye, hear ye! I''ll pause to sell my wares for only a short time here in Lakeshire. Come to the town hall with haste!',14,7,100,22,0,0,704,0,'Antonio Perelli'),
(844,12,0,'Good to see you again, Amy. Be safe, luv. I''m off to Goldshire now.',12,7,100,0,0,0,714,0,'Antonio Perelli'),
(844,13,0,'Hello, my friends. It is good to see you again. Still keeping our borders free I see. Antonio appreciates your hard work.',12,7,100,3,0,0,716,0,'Antonio Perelli'),
(844,14,0,'You''re very welcome! I must be on my way... be safe, all of you.',12,7,100,1,0,0,717,0,'Antonio Perelli'),
(844,15,0,'Oh, I will, my friend. I will indeed. You, too, be safe.',12,7,100,0,0,0,720,0,'Antonio Perelli'),
(844,16,0,'Items of antiquity, weapons of war, armor or rarity. Who knows what Antonio will be carrying this week if you do not come look.',14,7,100,22,0,0,685,0,'Antonio Perelli'),
(844,16,1,'This week it could be eye of newt, or perhaps a treasure map. You''ll never know unless you look. What could Antonio have?',14,7,100,22,0,0,686,0,'Antonio Perelli'),
(844,16,2,'Adventurers from all over sell things to Antonio-- come look for yourselves what little treasures he has for you this week.',14,7,100,22,0,0,687,0,'Antonio Perelli'),
